export default function About(){
    return (
        <div>
            <h1 className="About"> Welcome to SeenIt</h1>
            <p className="About"> Seenit is a social media website dedicated to letting you keep up with your interests and friends.</p>
            <h2 className="About2">Goal:</h2>
            <p className="About">Seenit allows you to find and talk to people interested in the same things as you.</p>
        </div>
    )
}
